message:
supportsApisパラメータの仕様変更。

下記の例ように、API仕様定義をプロファイルごとに分類するように修正。

{
    "supportsApis": [
        { <API定義> },
        { <API定義> }, ...
    ]
}

↓

{
    "supportsApis": {
        "canvas": [ { <API定義> }, ... ],
        "vibration": [ { <API定義> }, ... ], ...
    }
}

API仕様のメソッド・種別の定数をDConnectApiSpecConstantsへ移動。

DConnectApiを実装するときに、下記のようにメソッドの記述を短く書けるようにした。

public DConnectApiSpec.Method getMethod() {
    return DConnectApiSpec.Method.GET;
}
　↓
public Method getMethod() {
  return Method.GET;
}

Merge pull request #117 from TakayukiHoshi1984/bugfix_android_wear_notification

Fixed a bug that no notification message sent to Android Wear (only shown on smartphone)
Passed test with {LG G Watch R / SONY SmartWatch3} x {Nexus5 / SO-02G}
